  },
  filename: function (req, file, cb) {
    cb(null, file.originalname);
  }
})

const upload = multer({ storage });

// Sử dụng CORS middleware
app.use(cors());

// Route trả về trang HTML
app.get('/', (req, res) => {
    res.sendFile(path.join(__dirname, 'index.html'));
