const express = require("express");
const multer = require("multer");
const path = require("path");
const fs = require("fs");
const connectionDatabase = require("./connection_database");
const killPort = require("kill-port");
const { Prompt } = require("./src/models"); // Import model Prompt
const { Sequelize } = require("sequelize"); // Import Sequelize

const app = express();

// Tạo thư mục upload nếu chưa tồn tại
const uploadDir = path.join(__dirname, "uploads");
if (!fs.existsSync(uploadDir)) {
  console.log("Creating upload directory...");
  fs.mkdirSync(uploadDir);
}

const storage = multer.diskStorage({
  destination: function (req, file, cb) {
    cb(null, "uploads"); // Lưu file trong thư mục 'uploads'
  },
  filename: function (req, file, cb) {
    cb(null, Date.now() + "-" + file.originalname); // Đặt tên file với timestamp
  },
});

const upload = multer({ storage });

// Route xử lý upload file video
app.post("/api/upload", upload.single("video"), (req, res) => {
  if (!req.file) {
    return res.status(400).json({ error: "No file uploaded" });
  }

  res
    .status(200)
    .json({ message: "File uploaded successfully", file: req.file });
});

// Route để lấy đoạn text ngẫu nhiên từ database
app.get("/api/random-text", async (req, res) => {
  try {
    const prompt = await Prompt.findOne({ order: Sequelize.literal("RAND()") });
    if (prompt) {
      res.json({ text: prompt.Text });
    } else {
      res.status(404).json({ error: "No text found" });
    }
  } catch (error) {
    console.error("Error fetching random text:", error);
    res.status(500).json({ error: "Internal server error" });
  }
});

// Serve the HTML file
app.get("/", (req, res) => {
  res.sendFile(path.join(__dirname, "iindex.html"));
});

try {
  connectionDatabase();
  let port = process.env.PORT || 7000;

  console.log(`Trying to kill port ${port} if it's occupied...`);
  // Tắt cổng trước khi bắt đầu server
  killPort(port)
    .then(() => {
      console.log(
        `Port ${port} killed successfully or was not occupied. Starting server...`
      );
      const listener = app.listen(port, () => {
        console.log(`Server is listening on port ` + listener.address().port);
      });
    })
    .catch((err) => {
      console.error("Error killing port:", err);
    });
} catch (err) {
  console.error("Error initializing server:", err);
}

// Xử lý các lỗi không được bắt
process.on("uncaughtException", (err) => {
  console.error("Uncaught Exception:", err);
});

process.on("unhandledRejection", (reason, promise) => {
  console.error("Unhandled Rejection at:", promise, "reason:", reason);
});

// Giữ server chạy vô hạn định
setInterval(() => {}, 1 << 30);

